import Header from "./components/Header";

function App() {
  const name = "brad";
  const x = true;

  return (
    <div className="container">
      <h1>Hello from React</h1>
      <h2>
        Hello {name} {x ? "Yes" : "no"}
      </h2>
    </div>
  );
}

export default App;
